def search_pii_icp(dict_methods):
    pii_map = {0: ["Profile"], 1: ["Purchase", "PurchaseHistoryRecord"], 2: ["Environment"],
               3: ["FingerprintManager", "FingerprintManagerCompat", "BiometricPrompt"]}
    icp_map = {0: ["Calendar", "AccountManager", "Environment", "Contacts", "Calls", "SMS", "SipManager", "PendingRecording", "Voicemails",
                   "TelephonyManager", "TelephonyManagerCompat"], 1: ["WifiManager", "NetworkInfo", "NetworkCapabilities"], 2: ["BluetoothConfigManager"],
               3: ["ConnectivityManager", "ConnectivityManagerCompat"], 4: ["LocationManagerCompat", "LocationManager", "FusedLocationProviderClient"],
               5: ["AudioRecord", "MediaRecorder"], 6: ["Camera", "CameraManager", "CameraCaptureSession", "CameraDevice", "ImageCapture"],
               7: ["SensorManager"]}
    pii = set()
    icp = set()
    for i in dict_methods.get("found_input_methods").keys():
        for pii_i in pii_map.values():
            for values_pii in pii_i:
                if i.__contains__(values_pii):
                    pii.add(i)

    for i in dict_methods.get("found_input_methods").keys():
        for icp_i in icp_map.values():
            for values_icp in icp_i:
                if i.__contains__(values_icp):
                    icp.add(i)

    return (len(pii) / 4 * 100), (len(icp) / 8 * 100)


def createFeaturesForModel(a, methods):
    flag = False
    features_app = []
    tensor = [float(len(activities(a))), float(len(providers(a))), float(len(services(a)))]
    int_filt = intent_filter(a)
    for i in permission(a):
        features_app.append(i.split(".")[-1])
    for category in int_filt.values():
        for values in category.values():
            for string in values:
                features_app.append(string.split(".")[-1])

    for list_methods in methods.get("found_input_methods").values():
        for methods_s in list_methods:
            features_app.append(methods_s)
    for list_methods in methods.get("found_input_methods").values():
        for methods_s in list_methods:
            features_app.append(methods_s)

    for i in features:
        for j in features_app:
            if j == i:
                tensor.append(1.)
                flag = True
                break
        if not flag:
            tensor.append(0.)
        else:
            flag = False

    return tensor


def send_data_to_db(model, apk_file):
    category = ['OTHER', 'LIFESTYLE', 'EDUCATION', 'GAMES', 'TRAVEL', 'ENTERTAINMENT', 'BOOKS_AND_NEWS', 'TOOLS', 'COMMUNICATION']
    category_string = ""
    a, d, dx = misc.AnalyzeAPK(apk_file)
    methods_test = mapper_data_methods(dx)
    pii, icp = search_pii_icp(methods_test)
    tensor = createFeaturesForModel(a, methods_test)
    tensor.append(pii)
    tensor.append(icp)

    with tf.device('/cpu:0'):
        reconstructed_model = keras.models.load_model(model)  # my_h5_model.h5
    prediction_model = reconstructed_model.predict([tensor])

    pred_mod = str(prediction_model[0]).replace("  ", " ").split(" ")[1:-1]

    for idx, i in enumerate(pred_mod):
        category_string += category[idx] + ": " + i + "%, "

    cprint("                                             Основная информация                                                    ", "green")
    cprint("--------------------------------------------------------------------------------------------------------------------", "green")
    print("Название приложения: {}".format(a.get_app_name()))
    print("Пакет приложения: {}".format(a.get_package()))
    print("PII: {pii}%   ICP {icp}%".format(pii=pii, icp=icp))
    print("Категория приложения: {}".format(category_string[0:-2]))
    cprint("--------------------------------------------------------------------------------------------------------------------", "green")
    print()
    cprint("                                         Дополнительная информация                                                  ", "yellow")
    cprint("--------------------------------------------------------------------------------------------------------------------", "yellow")
    print("Найденные разрешения: {}".format(permission(a)))
    print("Найденные методы: {}".format(methods_test.get("found_input_methods")))
    print()
    print("Классы для взаимодействия с удаленными ресурсами: {}".format(methods_test.get("found_output_methods")))
    cprint("--------------------------------------------------------------------------------------------------------------------", "yellow")


args = parser.parse_args()
for i in args.apps.split(","):
    send_data_to_db(args.model, i)
